import React from "react";
import ct1 from "../../assets/img/chooseType-img/ct1.png";
import ct2 from "../../assets/img/chooseType-img/ct2.png";
import ct3 from "../../assets/img/chooseType-img/ct3.png";
import ct4 from "../../assets/img/chooseType-img/ct4.png";
import ct5 from "../../assets/img/chooseType-img/ct5.png";
import ct6 from "../../assets/img/chooseType-img/ct6.png";
import ct7 from "../../assets/img/chooseType-img/ct7.png";

export default function ChooseType() {
  // Array of image sources
  const imageSources = [ct1, ct2, ct3, ct4, ct5, ct6, ct7];

  return (
    <>
      <div className="project-div2">
        <div>
          <h2>Choose Type</h2>
        </div>
        <div className="choose-type-div">
          <div className="choose-type-div-card">
            {imageSources.map((imageSrc, index) => (
              <div key={index}>
                <div style={{ backgroundImage: `url(${imageSrc})` }}>
                  <div className="card-overlay"></div>
                </div>
                <h3>hii</h3>
              </div>
            ))}
          </div>
        </div>
        <div></div>
      </div>
    </>
  );
}
